import Post from './Post';
import '../style/Posts.css'
// import * as json from '../blogs.json'

function Posts() {

  const json = '[{"name":"Post 0","content":"Lorem Ipsum Lorem Ipsum Lorem Ipsum Lorem Ipsum Lorem Ipsum ","id":0,"date":"1.1.2020","image":"https://images.dog.ceo/breeds/terrier-welsh/lucy.jpg"},{"name":"Post 1","content":"Lorem Ipsum Lorem Ipsum Lorem Ipsum Lorem Ipsum Lorem Ipsum ","id":1,"date":"1.1.2020","image":"https://images.dog.ceo/breeds/terrier-welsh/lucy.jpg"},{"name":"Post 2","content":"Lorem Ipsum Lorem Ipsum Lorem Ipsum Lorem Ipsum Lorem Ipsum ","id":2,"date":"1.1.2020","image":"https://images.dog.ceo/breeds/terrier-welsh/lucy.jpg"},{"name":"Post 3","content":"Lorem Ipsum Lorem Ipsum Lorem Ipsum Lorem Ipsum Lorem Ipsum ","id":3,"date":"1.1.2020","image":"https://images.dog.ceo/breeds/terrier-welsh/lucy.jpg"},{"name":"Post 4","content":"Lorem Ipsum Lorem Ipsum Lorem Ipsum Lorem Ipsum Lorem Ipsum ","id":4,"date":"1.1.2020","image":"https://images.dog.ceo/breeds/terrier-welsh/lucy.jpg"}]';
  const posts = JSON.parse(json);

  return (
    <div>
      {posts.map((test) => {
        return <Post post={test} />
      })}
    </div>
  );
}

export default Posts;
